import React from 'react';
import Admin from 'react-admin'
import jsonServerProvider from 'ra-data-json-server';

const dataProvider= jsonServerProvider('http://localhost:8000')

const App = () => {
    return ( 
        <Admin dataProvider={dataProvider}></Admin>
     );
}
 
export default App;
